0ハル型タイコ･楕円タイコをメインサイレンサーに採用した柿本改EXHAUST SYSTEMを代表するKakimoto･Ｒは､音･性能共にバランスのとれた､オールラウンドタイプのマフラー。重低音の利いたクオリティーの高い音質と期待を裏切らないハイトルクとハイパワーを実現。柿本改のマフラーづくりのノウハウを高密度に凝縮した Kakimoto･Ｒ高次元なパフォーマンスを実現し、ストリート・サーキット問わず、スポーティーなシーンで十二分な性能を引き出してくれる。 <br>●材質:オールステンレス ●パイプ径（パイ）50/タイコ径（パイ）-/テール径（パイ）100 ●出口:S(右) 【納期】お取り寄せ商品のため通常3～4日でのお届けとなります。(日・祝日は除く)万が一欠品の場合は別途メールにてご連絡差し上げます。お急ぎの場合はご注文前に必ず納期確認を頂きますようお願い申し上げます。<br>【注意】●リアピースのみ ●モデューロエアロ取付OK ●Sパッケージ取付OK ●Sグレード車バンパーとのクリアランスが無い為吊りゴム要加工 <br>対応車種：02/9～07/10 GD3 フィット 1.5L 2WD エンジン型式：L15A <br>　保安基準適合品<br>排気系/マフラー<br>※送料は地域や配達場所によって変わりますが、6000円～12000円程度が目安となります。<tr><td colspan="2">
